import React, { Component } from "react";
class DebtComp extends Component {
  render() {
    return (
      <div className="card card-custom">
        <h6>Debt</h6>
        <form>
          <input type="text" name="debtName" />
          <input type="text" name="debtAmount" />
        </form>
        {/* list items */}
        <p className="debtItem" />
      </div>
    );
  }
}

export default DebtComp;
